cars.description:
Nissan Note 1.2 från 2015 - Superbil med enkelt ägande!

Säljer min Nissan Note, då jag vi behöver en större bil. – Det är en bränslesnål och pålitlig bil som passar perfekt både i stan och på längre sträckor. Bilen är välskött och i gott skick för sin ålder.

Låg bränsleförbrukning; 
Låg försäkringskostnad;
Låg fordonsskatt (endast 360:- per år); 
Gott om utrymme för både förare och passagerare; 
Billigt med underhåll och service;  
Perfekt bil om man inte har familj och behöver större;


Nämnvärd utrustning och tillbehör:
- AC;
- Bluetooth;
- Sätesvärmare;
- EL-uppvärmd vindruta;
- Vinterdäck kommer med.
